import { Actor, HttpAgent } from '@dfinity/agent';
import { idlFactory as hopechain_backend_idl } from '../declarations/';

const agent = new HttpAgent({ host: "http://127.0.0.1:4943" });
agent.fetchRootKey(); // Necessary for local development

const hopechain_backend_id = "asrmz-lmaaa-aaaaa-qaaeq-cai";

const hopechain_backend = Actor.createActor(hopechain_backend_idl, {
  agent,
  canisterId: hopechain_backend_id,
});

export default hopechain_backend;
